function removeNeighbours(arr) {
  const newArr = [];
  let a, b;
  a = arr.shift();
  let found = false;
  while(arr.length) {
    b = arr.shift();
    if ((b ^ a) === 32) {
      found = true;
      a = arr.shift();
    } else {
      newArr.push(a);
      a = b;
    }
  }
  newArr.push(a);
  if (found) {
    return removeNeighbours(newArr);
  }
  return newArr;
}

function part1(arr) {
  let numbers = [...arr].map((char) => char.charCodeAt());
  let index;

  numbers = removeNeighbours(numbers);
  let letters = numbers.map((num) => String.fromCharCode(num)).join('');
  return letters;
}

